import "./NewExpense.css";
function NewExpense() {
  return (
    // <div>
    <form>
        <div>
            <div>
                <label>Title</label>
                <input type="text"></input>
            </div>
            <div>
                <label>Amount</label>
                <input type="number" step="0.01" min="0"></input>
            </div>
            <div>
                <label>Date</label>
                <input type="date"></input>
            </div>
        </div>
    </form>
    // </div>
  );
}
export default NewExpense;
